import './App.css';

const Task = () => {
  const tasksList = ['Organizar Exercícios', 'Criar Portfólio', 'Preparar para aula'];
  return (
    <ul>
      {tasksList.map((task) => <li>{task}</li>)}
    </ul>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Lista de Tarefas</h2>
        <Task />
      </header>
    </div>
  );
}

export default App;
